var GbDataConvertor = function(){
	var parseId = function(id){
		var code = [];
		code.push(id[0]+id[1]);
		code.push(id[2]+id[3]);
		code.push(id[4]+id[5]);
		return code; 
	};
	var parseZxs = function(){
		var zxs = [];
		for(var i=0;i<gbData.length;i++){
			if(gbData[i][1]==="县"){
				code = parseId(gbData[i][0]);
				zxs.push(code[0]);
			}
		}
		return zxs;
	};
	var isZxs = function(zxs,code){
		for(var i=0;i<zxs.length;i++){
			if(zxs[i]==code)return true;
		}
		return false;
	};
	var resetData = function(){
		var zxs = parseZxs();
		var aaa = [];
		for(var i=0;i<gbData.length;i++){
			if(gbData[i][1]==="县" || gbData[i][1]==="市辖区"){
				continue;
			}
			code = parseId(gbData[i][0]);
			if(code[1]=="00"){//is province
				gbData[i].push(gbData[i][1]);
				gbData[i][1] = "";
			}else if(code[2]=="00"){//is city
				gbData[i].push(gbData[i][1]);
				gbData[i][1] = code[0]+"0000";
			}else{
				gbData[i].push(gbData[i][1]);
				gbData[i][1] = code[0]+code[1]+"00";
				/*
				if(isZxs(zxs,code[0])){//特别处理直辖市
					gbData[i][1] = code[0]+"0000";
				}else{
				}
				*/
			}
			aaa.push(gbData[i]);
		}
		return aaa;
	};
	var buildArrayData = function(){
		return resetData();
	}
	var linkedData = null;
	var getCity = function(pid){
		var str = "";
		var count = 0;
		for(var i=0;i<linkedData.length;i++){
			if(linkedData[i][1]==pid){
				if(count>0){str+=",";}
				count++;
				str += "<br>&nbsp;&nbsp;&nbsp;&nbsp;";
				str += '["'+linkedData[i][0]+'","'+linkedData[i][2]+'",['+getDist(linkedData[i][0])+']]';
			}
		}
		if(count>0){
			str += "<br>&nbsp;&nbsp;&nbsp;&nbsp;";
		}
		return str;
	};
	var getDist = function(cid){
		var str = "";
		var count = 0;
		for(var i=0;i<linkedData.length;i++){
			if(linkedData[i][1]==cid){
				if(count>0){str+=",";}

			}
		}
		if(count>0){
			str += "<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;";
		}
		return str;
	};
	var getfirst = function(){
		var str = "var JskitAreaSelectorData = [";
		str += '<br>["86","中国",[';
		var count = 0;
		for(var i=0;i<linkedData.length;i++){

				str += "<br>&nbsp;&nbsp;";

			}
		}
		str += '<br>]]';
		str += "<br>];";
		return str;
	};
	this.printHtmlCode = function(){
		linkedData = buildArrayData();
		document.write(getfirst());
	};
};
